import './App.css';
// import Mango from './Mango';
// import Sample from './Sample';
// const a=["apple","mango","kiwi"]

function App() {
  const a={
    name:"raha",
    gender:"F"
  }
  const b={
    name:"gia",
    age:18
  }
  const c={...a,...b}
  return (
    <div className="App">
      <h1>{c.name},{c.age},{c.gender}</h1>
    </div>
  );
}

export default App;
